import React from "react";
import "./Profile.css";

const Profile = () => {
  return (
    <div className="profile-container">
      <div className="profile-circle">
        <h3>User Profile</h3>
        <p>Name: John Doe</p>
        <p>Email: john.doe@example.com</p>
        <button>Edit Profile</button>
      </div>
    </div>
  );
};

export default Profile;
